import React, { FC } from "react";
import "./index.css";
import { Navbar } from "./components/Navbar";
import { Hero } from "./components/Hero";
const App: FC = () => {
  return (
    <div className="App font-body bg-salmon">
      <Navbar />
      <Hero />
    </div>
  );
};

export default App;
